ul {
  list-style: none;
  width: 400px;
}

.wrapper {
  margin: 50px;
  /* text-align: center;
  display: flex;
  align-items: center;
  justify-content: center;
  margin: 50px auto 0;
  flex-direction: column; */
  .box {
    border: 1px solid black;
    height: 140px;
    display: flex;
    flex: 1 2 auto;
  }
  .left-box {
    border: 1px solid black;
    background: red;
    flex: 1;
    img {
      width: 100%;
      height: 100%;
    }
  }
  .right-box {
    border: 1px solid black;
    background: purple;    
    flex: 2;
  }
}

h1 {
  margin-bottom: 20px;
}

.form {
  width: 400px;
}

.form__input {
  display: flex;
  width: 100%;
  border-bottom: 1px dashed gray;
  padding-bottom: 10px;
  height: 67px;
}

.form__edit-input {
  outline: none;
  border: none;
  font-size: 20px;
  width: 90%;
}

.visuallyhidden {
  border: 0;
  clip: rect(0 0 0 0);
  height: 1px;
  margin: -1px;
  overflow: hidden;
  padding: 0;
  position: absolute;
  width: 1px;
}
